import React from "react";
import Head from "next/head";
import Link from "next/link";

const Error = () => (
    <div className="text-sans mt-24">
        <Head>
            <title>Error</title>
            <link rel="icon" href="/favicon.ico" />
        </Head>

        <div className="w-full text-gray-900">
            <p className="text-center my-4 text-m">
                An Error Occurred!
            </p>
            <Link href="https://www.essentiallysports.com/">
                <button type="button" class="text-white bg-blue-700 hover:bg-blue-800 focus:ring-4 focus:ring-blue-300 rounded text-center my-4 text-m focus:outline-none">Read latest news from EssentiallySports</button>
            </Link>

        </div>

    </div>
);

export default Error;
